What other local spots are y’all’s favs?

a love letter to the local coffee shop on small business Saturday💌☕️

you might realize that I love coffee, and that I love shopping local… but aside from those things, I love all that coffee shops in this area bring to our lives🤍

Coffee shops are where I find myself most often, aside from my home and from my office… they are where I catch up with friends, celebrate milestones, and where creativity is ever flowing☕️

Coffee shops are very often where I hold my buyer consultations, and they make up such a fun start to the journey that is buying a home 🏡

cheers to the perfect space, and the perfect blend ☕️

Here are a few of my favs: 

@thelocalcupcoffeeco provides the perfect space to sit down and catch up, where I have had MANY buyer consultations. The people are friendly, and I’m always ecstatic to see someone I know 🤍 + the coffee truck is so fun for events 😉

@riversedgecoffeeco brings the fun flavors to the table, and is super convenient to my home and the 23111 🏡

@revirescocoffee ~ I found out about them through several clients who were celebrating their grand opening, I popped in that day, and am now always greeted so kindly! Not only that, but they helped me prep my own buyers closing gift 🎁

@ironcladcoffee is in Shockhoe bottom, and I’ve tried their coffee a few times, and have always loved their fun flavors and cookies served with their lattes

@grantcoffeecompany was down the street from my Chester listing, and the owner and environment are SO inviting ☕️

@roastologycoffee is my favorite place to stop in the city and work in between appointments 

and the list goes on, but are my favs from over the years❤️
